import TechStack from "./TechStack";

function Profile(props) {
    
    return (
        <>
            <div style ={{
                backgroundColor: "grey",
            }}>
                <img src="https://www.google.com.ph/url?sa=i&url=https%3A%2F%2Fsupport.hubstaff.com%2Fprofile-pictures-for-hubstaff-talent%2F&psig=AOvVaw23pjbDls-U9sdOIrCgo6Jb&ust=1675159468002000&source=images&cd=vfe&ved=0CBAQjRxqFwoTCOCZ9LiF7_wCFQAAAAAdAAAAABAD" alt="profile_image"  ></img><br/>
            </div>
            <div>
                <p style ={{
                    textAlign: "center",
                }}>
                My name is {props.name} and I am a {props.job} and I formerly work as {props.past_job}.<br/>

                At the moment I am currently studying these following tech stacks at KodeGo Bootcamp.<br/>
            <TechStack></TechStack>
                </p>
            </div>
        </>
    )
}

export default Profile;
